title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o2119.m19 -> o2071.m8 -> o2119.m19
  o2119.m16 -> o2071.m8 -> o2119.m19 -> o2071.m8
  o2071.m8 -> o2119.m19 -> o2071.m8
  o2119.m0 -> o2071.m9 -> o2119.m19 -> o2071.m8 -> o2119.m19
  o2071.m9 -> o2119.m19 -> o2071.m8 -> o2119.m19
  o2119.m1 -> o2071.m8 -> o2119.m19 -> o2071.m8
  o2130.m10 -> o2104.m28 -> o2130.m10
  o2104.m9 -> o2130.m10 -> o2104.m28 -> o2130.m10
  o2104.m28 -> o2130.m10 -> o2104.m28
  o2130.m2 -> o2104.m28 -> o2130.m10 -> o2104.m28
  o2089.m0 -> o2082.m18 -> o2089.m0
  o2082.m18 -> o2089.m0 -> o2082.m18

features:
  - inheritance
  - overriding
  - method
  - polymorphism

